INSERT INTO `t_infolist` VALUES ('8', 'a5ecfe90-16ae-4f9e-bebf-ecb3447fbc5a', '用户注册及使用APP隐私协议', '<p><span style=\"font-family:宋体\"><span style=\"font-size:16px\">在此特别提醒您（用户）在注册成为用户之前，请认真阅读本《用户协议》（以下简称“协议”），确保您充分理解本协议中各条款。请您审慎阅读并选择接受或不接受本协议。除非您接受本协议 所有条款，否则您无权注册、登录或使用本协议所涉服务。您的注册、登录、使用等行为将视为对 本协议的接受，并同意接受本协议各项条款的约束。本协议约定巢湖网与用户之间关于“巢湖网” 软件服务（以下简称“服务”）的权利义务。“用户”是指注册、登录、使用本服务的个人。本协议可由巢湖网随时更新，更新后的协议条款一旦公布即代替原来的协议条款，恕不再另行通知，用户可在本APP中查阅最新版协议条款。在修改协议条款后，如果用户不接受修改后的条款，请立即停止使用巢湖网提供的服务，用户继续使用巢湖网提供的服务将被视为接受修改后的协议。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp;&nbsp;<span style=\"word-wrap: break-word; font-weight: 700;\">一、账号注册</span></span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 1、用户在使用本服务前需要注册一个“巢湖网”账号。“巢湖网”账号应当使用手机号码绑定注册 ，请用户使用尚未与“巢湖网”账号绑定的手机号码，以及未被巢湖网根据本协议封禁的手机号码注册“巢湖网”账号。巢湖网可以根据用户需求或产品需要对账号注册和绑定的方式进行变更，而无须事先通知用户。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 2、“巢湖网”系基于同城服务的APP产品，用户注册时应当授权巢湖网公开及使用其个人信息方可成功注册“巢湖网”账号。故用户完成注册即表明用户同意巢湖网提取、公开及使用用户的信息。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 3、鉴于“巢湖网”账号的绑定注册方式，您同意巢湖网在注册时将允许您的手机号码及手机设备识 别码等信息用于注册。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 4、在用户注册及使用本服务时，巢湖网需要搜集能识别用户身份的个人信息以便巢湖网可以在必要时联系用户，或为用户提供更好的使用体验。巢湖网搜集的信息包括但不限于用户的姓名、地址；巢湖网同意对这些信息的使用将受限于第三条用户个人隐私信息保护的约束。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp;&nbsp;<span style=\"word-wrap: break-word; font-weight: 700;\">二、用户个人隐私信息保护</span></span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 1、如果巢湖网发现或收到他人举报或投诉用户违反本协议约定的，巢湖网有权不经通知随时对相关 内容，包括但不限于用户资料、发贴记录进行审查、删除，并视情节轻重对违规账号处以包括但不 限于警告、账号封禁 、设备封禁 、功能封禁的处罚，且通知用户处理结果。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 2、因违反用户协议被封禁的用户，可以自行与巢湖网联系。其中，被实施功能封禁的用户会在封禁 期届满后自动恢复被封禁功能。被封禁用户可提交申诉，巢湖网将对申诉进行审查，并自行合理判 断决定是否变更处罚措施。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 3、用户理解并同意，巢湖网有权依合理判断对违反有关法律法规或本协议规定的行为进行处罚，对违法违规的任何用户采取适当的法律行动，并依据法律法规保存有关信息向有关部门报告等，用户 应承担由此而产生的一切法律责任。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 4、用户理解并同意，因用户违反本协议约定，导致或产生的任何第三方主张的任何索赔、要求或损失，包括合理的律师费，用户应当赔偿巢湖网与合作公司、关联公司，并使之免受损害。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp;&nbsp;<span style=\"word-wrap: break-word; font-weight: 700;\">三、用户发布内容规范</span></span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 1、本条所述内容是指用户使用巢湖网的过程中所制作、上载、复制、发布、传播的任何内容，包括但不限于账号头像、名称、用户说明等注册信息及认证资料，或文字、语音、图片、视频、图文等 发送、回复或自动回复消息和相关链接页面，以及其他使用账号或本服务所产生的内容。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 2、用户不得利用“巢湖网”账号或本服务制作、上载、复制、发布、传播如下法律、法规和政策禁止的内容：</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (1) 反对宪法所确定的基本原则的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (2) 危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (3) 损害国家荣誉和利益的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (4) 煽动民族仇恨、民族歧视，破坏民族团结的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (5) 破坏国家宗教政策，宣扬邪教和封建迷信的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (6) 散布谣言，扰乱社会秩序，破坏社会稳定的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (7) 散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (8) 侮辱或者诽谤他人，侵害他人合法权益的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (9) 含有法律、行政法规禁止的其他内容的信息。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 3、用户不得利用“巢湖网”账号或本服务制作、上载、复制、发布、传播如下干扰“巢湖网”正常运营，以及侵犯其他用户或 第三方合法权益的内容：</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (1) 含有任何性或性暗示的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (2) 含有辱骂、恐吓、威胁内容的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (3) 含有骚扰、垃圾广告、恶意信息、诱骗信息的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (4) 涉及他人隐私、个人信息或资料的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (5) 侵害他人名誉权、肖像权、知识产权、商业秘密等合法权利的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (6) 含有其他干扰本服务正常运营和侵犯其他用户或第三方合法权益内容的信息。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\"><span style=\"word-wrap: break-word; font-weight: 700;\">&nbsp; &nbsp; 四、使用规则</span></span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 1、用户在本服务中或通过本服务所传送、发布的任何内容并不反映或代表，也不得被视为反映或代 表巢湖网的观点、立场或政策，巢湖网对此不承担任何责任。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 2、用户不得利用“巢湖网”账号或本服务进行如下行为：</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (1) 提交、发布虚假信息，或盗用他人头像或资料，冒充、利用他人名义的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (2) 强制、诱导其他用户关注、点击链接页面或分享信息的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (3) 虚构事实、隐瞒真相以误导、欺骗他人的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (4) 利用技术手段批量建立虚假账号的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (5) 利用“巢湖网”账号或本服务从事任何违法犯罪活动的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (6) 制作、发布与以上行为相关的方法、工具，或对此类方法、工具进行运营或传播，无论这些行为是否为商业目的；</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; (7) 其他违反法律法规规定、侵犯其他用户合法权益、干扰“巢湖网”正常运营或巢湖网未明示授 权的行为。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 3、用户须对利用“巢湖网”账号或本服务传送信息的真实性、合法性、无害性、准确性、有效性等 全权负责，与用户所传播的信息相关的任何法律责任由用户自行承担，与巢湖网无关。如因此给巢湖网或第三方造成损害的，用户应当依法予以赔偿。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 4、巢湖网提供的服务中可能包括广告，用户同意在使用过程中显示巢湖网和第三方供应商、合作伙伴提供的广告。除法律法规明确规定外，用户应自行对依该广告信息进行的交易负责，对用户因依该广告信息进行的交易或前述广告商提供的内容而遭受的损失或损害，巢湖网不承担任何责任。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp;&nbsp;<span style=\"word-wrap: break-word; font-weight: 700;\">五、其他</span></span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 1、巢湖网郑重提醒用户注意本协议中免除巢湖网责任和限制用户权利的条款，请用户仔细阅读，自主考虑风险。未成年人应在法定监护人的陪同下阅读本协议。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 2、本协议的效力、解释及纠纷的解决，适用于中华人民共和国法律。若用户和巢湖网之间发生任何纠纷或争议，首先应友好协商解决，协商不成的，用户同意将纠纷或争议提交巢湖网住所地有管辖权的人民法院管辖。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 3、本协议的任何条款无论因何种原因无效或不具可执行性，其余条款仍有效，对双方具有约束力。</span></span><br/><span style=\"font-family:宋体\"><span style=\"font-size:16px\">&nbsp; &nbsp; 4、本协议最终解释权归巢湖网所有，据苹果公司免责条款特此声明：该应用注册及隐私协议与苹果公司无关。</span></span></p>', '/info/infoList.html?infoid=a5ecfe90-16ae-4f9e-bebf-ecb3447fbc5a', null, '3');
